import React, { Component } from 'react';
import { Card, Form, Button, Col, Row } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCar, faPalette, faCalendarAlt, faDollarSign } from '@fortawesome/free-solid-svg-icons';

export default class Voiture extends Component {
  constructor(props) {
    super(props);
    // Initialize state
    this.state = {
      marque: '',
      modele: '',
      couleur: '',
      annee: '',
      prix: ''
    };

    // Bind methods to provide context
    this.voitureChange = this.voitureChange.bind(this);
    this.submitVoiture = this.submitVoiture.bind(this);
  }

  voitureChange(event) {
    // Update state with form input changes
    this.setState({ [event.target.name]: event.target.value });
  }

  submitVoiture(event) {
    // Prevent default form submission behavior
    event.preventDefault();
    alert(`Car Added: ${this.state.marque}`);
  }

  render() {
    return (
      <Card className="border border-dark bg-dark text-white">
        <Card.Header>
          <FontAwesomeIcon icon={faCar} /> Ajouter Voiture
        </Card.Header>
        <Form onSubmit={this.submitVoiture} id="VoitureFormId">
          <Card.Body>
            <Row>
              <Form.Group as={Col} controlId="formGridMarque">
                <Form.Label>
                  <FontAwesomeIcon icon={faCar} /> Marque
                </Form.Label>
                <Form.Control
                  name="marque"
                  type="text"
                  className="bg-dark text-white"
                  placeholder="Entrez Marque Voiture"
                  value={this.state.marque}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
              <Form.Group as={Col} controlId="formGridModele">
                <Form.Label>
                  <FontAwesomeIcon icon={faCar} /> Modèle
                </Form.Label>
                <Form.Control
                  name="modele"
                  type="text"
                  className="bg-dark text-white"
                  placeholder="Entrez Modèle Voiture"
                  value={this.state.modele}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
            </Row>
            <Row>
              <Form.Group as={Col} controlId="formGridCouleur">
                <Form.Label>
                  <FontAwesomeIcon icon={faPalette} /> Couleur
                </Form.Label>
                <Form.Control
                  name="couleur"
                  type="text"
                  className="bg-dark text-white"
                  placeholder="Entrez Couleur Voiture"
                  value={this.state.couleur}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
              <Form.Group as={Col} controlId="formGridAnnee">
                <Form.Label>
                  <FontAwesomeIcon icon={faCalendarAlt} /> Année
                </Form.Label>
                <Form.Control
                  name="annee"
                  type="number"
                  className="bg-dark text-white"
                  placeholder="Entrez Année Voiture"
                  value={this.state.annee}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
              <Form.Group as={Col} controlId="formGridPrix">
                <Form.Label>
                  <FontAwesomeIcon icon={faDollarSign} /> Prix
                </Form.Label>
                <Form.Control
                  name="prix"
                  type="number"
                  className="bg-dark text-white"
                  placeholder="Entrez Prix Voiture"
                  value={this.state.prix}
                  onChange={this.voitureChange}
                  required
                />
              </Form.Group>
            </Row>
          </Card.Body>
          <Card.Footer style={{ textAlign: "right" }}>
            <Button size="sm" variant="success" type="submit">
              Submit
            </Button>
          </Card.Footer>
        </Form>
      </Card>
    );
  }
}
